import * as React from "react";
import { useState, useEffect } from "react";
import styled from "styled-components";
import axios from "axios";
import CategorieTab from "../components/CategoryTab";

export default function Home() {
  const [categorieDB, setCategorieDB] = useState<any>([]);

  const axios_GetCategorie = async () => {
    await axios
      .get("./data/Categories.json")
      .then((res) => setCategorieDB(res.data.CATEGORIES));
  };
  useEffect(() => {
    axios_GetCategorie();
  }, []);
  console.log(categorieDB);
  return (
    <Container>
      <Header>커뮤니티</Header>
      <Buttons>
        <Button>
          {categorieDB.map((el: any, index: number) => (
            <CategorieTab key={index} item={el} />
          ))}
        </Button>
      </Buttons>
    </Container>
  );
}

const Container = styled.div`
  display: flex;
  flex-direction: column;

  border: solid grey 1px;
  border-radius: 10px;
  width: 390px;
  height: 844px;
`;
const Header = styled.header`
  margin-top: 34px;
  margin-left: 30px;
  margin-bottom: 40px;
  width: 81px;
  line-height: 32px;
  height: 32px;
  font-weight: 700;
  font-size: 22px;
`;
const Buttons = styled.div``;
const Button = styled.ul``;
